SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

-- CREATE DATABASE -- 
CREATE DATABASE IF NOT EXISTS `pourpre` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE `pourpre`;

-- CREATE TASK -- 
DROP TABLE IF EXISTS `task`;
CREATE TABLE `task` (
  `id` int(11) NOT NULL,
  `staff_id` int(11) NOT NULL,
  `house_id` int(11) NOT NULL,
  `task_name` varchar(255) NOT NULL,
  `note` text NOT NULL,
  `task_status` varchar(255) NOT NULL DEFAULT 'En cours'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- CREATE USERS_STAFF -- 
DROP TABLE IF EXISTS `users_staff`;
CREATE TABLE `users_staff` (
  `id` int(244) NOT NULL,
  `name` varchar(255) NOT NULL,
  `first_name` varchar(255) NOT NULL,
  `gender` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `phone_number` int(100) NOT NULL,
  `avatar` mediumtext NOT NULL,
  `role` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- CREATE USERS -- 
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `first_name` varchar(255) NOT NULL,
  `gender` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `phone_number` varchar(20) NOT NULL,
  `avatar` mediumtext NOT NULL,
  `role` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- ADD HOUSE -- 
DROP TABLE IF EXISTS `house`;
CREATE TABLE `house` (
  `id` int(11) NOT NULL,
  `img` mediumtext DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
  `adress` varchar(200) DEFAULT NULL,
  `postal_code` int(5) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `num_room` int(2) DEFAULT NULL,
  `description` varchar(500) NOT NULL,
  `option_premium` varchar(200) NOT NULL,
  `status` enum('Disponible','Indisponible') DEFAULT 'Indisponible',
  `price` int(3) NOT NULL,
  `number_reservation` int(11) NOT NULL DEFAULT 0,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;


-- ADD NOTICE  ADMIN -- 
DROP TABLE IF EXISTS `notice_admin`;
CREATE TABLE `notice_admin` (
  `id` int(11) NOT NULL,
  `task_name` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `house_id` int(11) NOT NULL,
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `date` datetime NOT NULL DEFAULT current_timestamp(),
  `type_task` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- ADD NOTICE STAFF-- 
DROP TABLE IF EXISTS `notice_staff`;
CREATE TABLE `notice_staff` (
  `id` int(255) NOT NULL,
  `task_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `house_id` int(255) NOT NULL,
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `date` datetime NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;


-- INTER TABLE REVIEW --
DROP TABLE IF EXISTS `review`;
CREATE TABLE `review` (
  `id` int(11) NOT NULL,
  `house_id` int(11) NOT NULL,
  `users_id` int(11) NOT NULL,
  `users_name` varchar(255) NOT NULL,
  `users_first_name`varchar(255) NOT NULL,
  `date` date NOT NULL DEFAULT current_timestamp(),
  `comment` varchar(500) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- INTER TABLE eMAIL
DROP TABLE IF EXISTS `email` ;
CREATE TABLE `email` (
  `id` int(11) NOT NULL,
  `users_id` int(11) NOT NULL,
  `email` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `date` date NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

-- INTER TABLE MESSAGES
DROP TABLE IF EXISTS `messages` ;
CREATE TABLE `messages` (
  `id` int(11) NOT NULL,
  `sender_id` int(11) NOT NULL,
  `receive_id` int(11) NOT NULL,
  `message_content` text NOT NULL,
  `date_insert` datetime NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;


