(1, 'data:image/jpeg;base64,', 'Le Coeur de l\'Or', '12 rue des Bergers', 75003, 'Maison', 3, 'Paisible maison loin des routes et proche d\'une petite forêt pour se balader librement', 'Standard', 'Disponible', 150, 20, NULL, NULL);
INSERT INTO `house` (`id`, `img`, `name`, `adress`, `postal_code`, `type`, `num_room`, `description`, `option_premium`, `status`, `price`, `number_reservation`, `start_date`, `end_date`) VALUES
(2, 'data:image/jpeg;base64,', 'Chromet', '68 avenue du Séjour', 75007, 'Appartement', 2, 'Cet appartement se trouve dans le quartier résidentiel du 7e arrondissement de Paris, à quelques pas de la Tour Eiffel. Il est situé au quatrième étage d\'un immeuble haussmannien classique, offrant ainsi une vue imprenable sur la Tour Eiffel depuis ses grandes fenêtres.', 'Standard', 'Disponible', 100, 42, NULL, NULL);
INSERT INTO `house` (`id`, `img`, `name`, `adress`, `postal_code`, `type`, `num_room`, `description`, `option_premium`, `status`, `price`, `number_reservation`, `start_date`, `end_date`) VALUES
(3, 'data:image/png;base64,', 'Champ de Mars', '23 rue des Cerises', 75006, 'Appartement', 3, 'L\'appartement comprend trois chambres luxueuses. La chambre principale dispose d\'un lit king-size, d\'une télévision et d\'une salle de bains privative avec une baignoire jacuzzi. Les deux autres chambres sont équipées de lits doubles confortables et d\'espaces de rangement généreux. Une deuxième salle de bains avec douche est également disponible pour les autres occupants de l\'appartement.', 'Standard', 'Indisponible', 200, 52,'2023-06-25', '2023-06-27');
INSERT INTO `house` (`id`, `img`, `name`, `adress`, `postal_code`, `type`, `num_room`, `description`, `option_premium`, `status`, `price`, `number_reservation`, `start_date`, `end_date`) VALUES
(4, 'data:image/jpeg;base64,', 'Violette', '56 boulevard des Puces', 75009, 'Appartement', 2, 'Cet appartement bénéficie d\'un emplacement idéal. En sortant de l\'immeuble, vous êtes à quelques minutes à pied de la Tour Eiffel et de ses jardins environnants. Les boutiques, les restaurants et les cafés du quartier sont également facilement accessibles à pied. De plus, les transports en commun sont à proximité, vous permettant de vous déplacer facilement dans toute la ville.', 'Standard', 'Indisponible', 130, 30, '2023-06-20', '2023-07-01');
INSERT INTO `house` (`id`, `img`, `name`, `adress`, `postal_code`, `type`, `num_room`, `description`, `option_premium`, `status`, `price`, `number_reservation`, `start_date`, `end_date`) VALUES
(5, 'data:image/jpeg;base64,', 'Chat noir', '123 rue de la Noisette', 75002, 'Maison', 2, 'La maison offre un mélange harmonieux de confort moderne et de charme traditionnel. Les façades sont ornées de détails architecturaux élégants, tandis que l\'intérieur présente des espaces spacieux et accueillants. Les pièces lumineuses et aérées sont aménagées avec goût, créant une atmosphère chaleureuse et conviviale.', 'Standard', 'Disponible', 120, 33, NULL, NULL);


